import styled from 'styled-components';
import Nav from './Nav';

const HeaderStyles = styled.header`
  .sub-bar {
    display: grid;
    grid-template-columns: 1fr auto;
  }
`

const Header = () => (
  <HeaderS>
    <Nav />
    <div className="sub-bar">
      <p>Search</p>
    </div>
  </HeaderS>
);

export default Header;
